import Autocomplete from './AutoComplete';


const CreateBusiness = (props) => {

    return (
        <div className="App">
          <Autocomplete
            options={[
              'Papaya',
              'Persimmon',
              'Paw Paw',
              'Prickly Pear',
              'Peach',
              'Pomegranate',
              'Pineapple'
            ]}
          />
        </div>
      );
    };

export default CreateBusiness
